// ComparisonPage.js

import React from 'react';
import { Typography, Container } from '@mui/material';

function ComparisonPage({ userOneAccessToken, userTwoAccessToken }) {
    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Music Taste Comparison Results
            </Typography>
            {/* Implement your comparison logic and display results here */}
            <Typography>
                This is where the comparison results between the two users will be displayed.
            </Typography>
        </Container>
    );
}

export default ComparisonPage;
